webpackJsonp([0xff7aa830aac6],{5506:function(e,t){e.exports={data:{post:{html:"<p>Heard on <a href=\"http://www.ndr4.de\">NDR4</a>: The EU Commission is suing the EU Council of Ministers for overturning a Commission decision. The decision (involving pork subsidies in Portugal) was rather minor, but was overturned for purely politcal reasons.<br />\nIt's interesting in light of the ministers overturning the budget warning for Germany, and recent comments by European politicians that the Commission has become too powerful and that more European decision-making should be made at the national and regional level.<br />\nIt's also interesting that I cannot find a single web link to this story.</p>",fields:{title:"Who's Boss In The EU?",date:"28 Feb 2002",url:"https://papascott.de/2002-02-28-whos-boss-in-the-eu/"}}},pathContext:{slug:"/2002-02-28-whos-boss-in-the-eu/",prev:{fields:{title:"Unfriendly Veal",date:"28 Feb 2002",slug:"/2002-02-28-unfriendly-veal/"}},next:{fields:{title:"Clear Head",date:"01 Mar 2002",slug:"/2002-03-01-clear-head/"}}}}}});
